import React from "react";

export default function Product({props}) {
        return (
        <ul>
            {props.products.map((product)=>
            (<li key={product.id}>Product:{product.name}</li>))}
        </ul>
        // <div>
        //     <h2>Product:{title}==={description}</h2>
        // </div>
    )     
}
